"""https://leetcode.com/problems/find-the-difference/"""
from collections import Counter


def find_the_difference(s, t):
    counter_s = Counter(s)
    counter_t = Counter(t)
    symmetric_diff = set(counter_s.items()) ^ set(counter_t.items())
    return next(iter(symmetric_diff))[0] if symmetric_diff else t[0]


def main():
    s = ""
    t = ""
    char = find_the_difference(s, t)
    assert char == 't'



if __name__ == '__main__':
    main()